import React, { useState } from 'react';
import Modal from 'react-modal';
import { ButtonContactStyled } from './ButtonContact.styles';

const customStyles = {
  content: {
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
  },
};

const ButtonContact = () => {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  const handleModal = () => {
    setModalIsOpen(!modalIsOpen);
  };
  return (
    <>
      <ButtonContactStyled isWeb>Entre em contato</ButtonContactStyled>
      <ButtonContactStyled isMobile>Entre em contato</ButtonContactStyled>

      <Modal isOpen={modalIsOpen} onRequestClose={handleCloseModal} style={customStyles} contentLabel="Example Modal">
        <h2>Hello</h2>
        <button onClick={handleCloseModal}>close</button>
        <div>I am a modal</div>
        <form>
          <input />
          <button>tab navigation</button>
          <button>stays</button>
          <button>inside</button>
          <button>the modal</button>
        </form>
      </Modal>
    </>
  );
};

export default ButtonContact;
